import {
  ADD_TODO,
  EXAMPLE
} from '../actions/types'

const initialState = {
  one: 'Zero'
}

const first = (state = initialState, action) => {
  let nextState = Object.assign({}, state)
  switch (action.type) {
    case ADD_TODO:
      nextState = action.payload
      return nextState
    case EXAMPLE:
      nextState.one = 'TEN'
      return nextState
    default:
      return state
  }
}

export default first
